                        return true;
                    }
                }
            }
            return false;
        }

    }


    private class Values extends AbstractCollection<V> {

        @Override
        public int size() {
            return StaticBucketMap.this.size();
        }

        @Override
        public void clear() {
            StaticBucketMap.this.clear();
        }

        @Override
        public Iterator<V> iterator() {
            return new ValueIterator();
        }

    }

    /**
